import React from 'react';
import ReactDOM from 'react-dom';
import QrScanner from './QrScanner';

function App() {
    return (
        <div>
            <h1>QR Code Scanner</h1>
            <QrScanner />
        </div>
    );
}

ReactDOM.render(<App />, document.getElementById('root'));
